const optionsData = [
  {
    title: 'timer',
    options: [
      "30", "45", "60", "75", "90", "105", "120",
    ]
  }, 
  {
    title: 'type',
    options: [
      'en-ua',
      'ua-en',
    ]
  },
  {
    title: 'words',
    options: [
      "10", "15", "20", "25", "30",
    ]
  }, 
  {
    title: 'random',
    options: [
      "true", "false"
    ]
  }
];

export default optionsData;
